    false,nt"url": null,nt"notes": "A GIS polygon shapefile outlining the boundaries
    of the native input datasets used to construct a seamless, 2-meter resolution digital
    elevation model (DEM) was constructed for the open-coast region of the San Francisco
    Bay Area (outside of the Golden Gate Bridge), extending from Half Moon Bay to Bodega
    Head along the North-central California coastline. The goal was to integrate the
    most recent high-resolution bathymetric and topographic datasets available (for
    example, Light Detection and Ranging (lidar) topography, multibeam and single-beam
    sonar bathymetry) into a seamless surface model extending offshore at least 3 nautical
    miles and inland beyond the +20 m elevation contour.",nt"license_title": null,nt"extras":
